const CartProvider = ({ children }) => {
  const [customizedImage, setCustomizedImage] = useState();
  const [cartState, dispatch] = useReducer(reducer, initialState);

  // const [quantity, setQuantity] = React.useState(1);
  // const addQuantity = (value) => {
  //     setQuantity(value + 1);
  // }
  // const subtractQuantity = (value) => {
  //     if (value > 1) {
  //         setQuantity(value - 1);
  //     }
  // }

  //! Add to cart function, has the data of 1 product from single product page
  const addToCart = (
    id,
    color,
    size,
    quantity,
    product,
    customizedImage,
    customSize
  ) => {
    dispatch({
      type: "ADD_TO_CART",
      payload: {
        id,
        color,
        size,
        quantity,
        product,
        customizedImage,
        customSize,
      },
    });
    setCustomizedImage();
    // setQuantity(1);
  };

  const increaseQuantity = (id) => {
    dispatch({ type: "INCREASE_QUANTITY", payload: id });
  };

  const decreaseQuantity = (id) => {
    dispatch({ type: "DECREASE_QUANTITY", payload: id });
  };

  const removeCartItem = (id) => {
    dispatch({ type: "REMOVE_CART_ITEM", payload: id });
  };

  // const clearCart = () => {
  //     dispatch({type: 'CLEAR_CART'})
  // }

  useEffect(() => {
    console.log(cartState);
  }, [cartState]);
  //! Adding cart to local storage
  useEffect(() => {
    dispatch({ type: "CART_TOTAL_ITEMS" });
    dispatch({ type: "CART_TOTAL_PRICE" });
    // localStorage.setItem('cart', JSON.stringify(state.cart));
  }, [cartState.cart]);

  return (
    <CartContext.Provider
      value={{
        cartState,
        ...cartState,
        addToCart,
        // clearCart,
        // quantity,
        // setQuantity,
        // addQuantity,
        // subtractQuantity,
        removeCartItem,
        increaseQuantity,
        decreaseQuantity,
        customizedImage,
        setCustomizedImage,
      }}
    >
      {children}
    </CartContext.Provider>
  );
};

const useCartContext = () => {
  return useContext(CartContext);
};

